  \"2013-08-23T14:19:16.524614\",\n\t\"name\": \"va-atlantic-coast-recreational-use\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"As a member of the Mid-Atlantic Regional
  Council on the Ocean (MARCO), Virginia, through its Coastal Zone Management (CZM)
  Program, collected information on how the public uses the Atlantic coast of Virginia
  through a two day particpatory GIS workshop in July of 2012. These baseline data
  were collected to inform planning efforts being undertaken by Virginia CZM to help
  develop a Virginia Ocean Plan, to help Virginia CZM and the Accomack-Northampton
  Planning District Commission (A-NPDC) to continue development of the Seaside Special
  Area Management Plan, and to be incorporated into a regional recreational ocean
  use dataset that will eventually be displayed on the MARCO data portal.\",\n\t\"license_title\":
